import React from "react";
import { Link } from "react-router-dom";

export default function StudentDetails(props) { 


  return (<>
  <h1>EMPLOYEE FEED BACK DATA</h1>
          <div className="row">
            {props.detailsList.map((details, i) => (
              <p key={i}>
                Name : {details.name} | Department {details.department} | Rating
                :{details.rating}             <Link to={"/editDetails"} state={{data:i}}>Edit</Link> | <Link to={"/delete/"+i}>Delete</Link>
              </p>
            ))}
          </div>
          </>);
}
